// @flow
import React from 'react';
import { Row, Col } from 'reactstrap';
import Properties from "./Properties";

import SearchPlace from './SearchPlace';


const AnalyticsDashboardPage = () => {
    return (
        <React.Fragment>
            <Row>
                <Col lg={6}>
                    <SearchPlace />
                </Col>
            </Row>
            <Row>
                <Col lg={6}>
                    <Properties />
                </Col>
            </Row>
        </React.Fragment>
    );
};

export default AnalyticsDashboardPage;
